import React, { Component } from "react";
import { Button, View, Text } from "react-native";

export default function Home({ navigation }) {
  //console.log(this.screenProps.handleLogin);
  const isAuthenticated = localStorage.getItem("token");
  if (isAuthenticated === false) {
    return (
      <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
        <Text>Welcome!</Text>
        <Button
          title="Go to Fitnessinfo"
          onPress={() => navigation.navigate("Fitnessinfo")}
        />
        <Button
          title="Go to Fitnessplan"
          onPress={() => navigation.navigate("Fitnessplan")}
        />
        {
          <Button
            title="Go to Login"
            onPress={() => navigation.navigate("Login")}
          />
        }
        <Button
          title="Logout"
          onPress={() => this.props.route.params.handleLogout()}
        />
      </View>
    );
  } else {
    return (
      <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
        <Text>Eingeloggt!</Text>
        <Button
          title="Go to Fitnessinfo"
          onPress={() =>
            navigation.navigate(
              isAuthenticated ? "FitnessinfoAdmin" : "Fitnessinfo"
            )
          }
        />
        <Button
          title="Go to Fitnessplan"
          onPress={() => navigation.navigate("Fitnessplan")}
        />
        {
          <Button
            title="Go to Login"
            onPress={() => navigation.navigate("Login")}
          />
        }
        <Button
          title="Logout"
          onPress={() => this.props.route.params.handleLogout()}
        />
      </View>
    );
  }
}

